 declare t_tedavi_id int;
 declare id int ;
declare t_miktar int ;

begin
     id:=  (SELECT max(islem_id) FROM islem_kayıt order by ID desc );
    t_tedavi_id:=(select "tedavi_id" from "islem_kayıt" where "islem_kayıt"."islem_id"=id);
    
    t_personel_id:=(select "personel_id" from "islem_kayıt" where "islem_kayıt"."islem_id"=id);
    
